import React, { useState } from "react";

function PageNumber(props) {
  const [pageNumber, setPageSize] = useState(1);

  const handleSizeChange = (event) => {
    const selectedSize = event.target.value;
    setPageSize(selectedSize);
    props.onSizeChange(selectedSize);
    console.log("hola", selectedSize);
  };

  return (
    <div>
        <label for="resPerPage">Results per page:</label>
        <select name="resPerPage" id="resPerPage" onClick={handleSizeChange}>
        <option value={10}>10</option>
        <option value={20}>20</option>
        <option value={50}>50</option>
        </select>
    </div>
  );
}

export default PageNumber;
